import {
    connect
} from "react-redux";
import {
    useState
} from 'react';

const BASE_URL = "https://5e9935925eabe7001681c856.mockapi.io/api/v1/catalog/";

export const getCatalog = () => {
    return fetch(BASE_URL)
        .then(res => res.json())
        .then(data => data);
}
